    public int lengthOfLongestSubstring(String s) {

        Map<Character, Integer> map = new HashMap<>();
        int maxlen = 0;
        int i = 0, j = 0;
        while (j < s.length()) {

            int index = map.getOrDefault(s.charAt(j), -1);

            if (index >= 0) { // 重复了
                if (j - i > maxlen)
                    maxlen = j - i;
                //删除index小于等于key的键
                for(int k=i;k<=index;k++){
                    map.remove(s.charAt(k));
                }

                i = index + 1;
            } else {
                map.put(s.charAt(j), j);
                j++;
            }
        }

        if (j - i > maxlen) {
            maxlen = j - i;
        }

        return maxlen;

    }
